import logo from "../images/logo.png";
import "../stylesheets/App.scss";

const Header = () => {
  return (
    <header className="header">
      <img
        className="header-title"
        src={logo}
        alt="Rick and Morty "
        title="Rick and Morty "
      />
    </header>
  );
};

export default Header;
